import React from "react"
import Symbols from "./Symbols"
import './style.css';
import Draggable from 'react-draggable';
import './desktop.css'
import ParticleBackground from "./ParticleBackground"

function Desktop() {
  let isDragging = false;
  function onDrag(e) {
    console.log("onDrag");
    isDragging = true;
  }
  function onStop(e) {
    console.log("onStop");
    setTimeout(() => (isDragging = false), 0);
  }
  function onClick(e) {
    console.log("onclick");
    console.log({ isDragging });
  }

  return (
    <desktop id="desktop">
      <ParticleBackground />
      <Draggable
        onStop={onStop} onDrag={onDrag}
        parent={"desktop"}>
      <div class="Symb">
          <Symbols title="Spotify" icon="" onClick={onClick}/>
          <Symbols title="Instagram" icon="" />
          <Symbols title="Vids" icon="" />
          <Symbols title="Drawings/Designs" icon="" />
          <Symbols title="Photos" icon="" />
          <Symbols title="Notes" icon="" />
      </div>
      </Draggable>
    </desktop>
  );
}

export default Desktop;
